import React from 'react';
import MenuCard from '../menuCard/MenuCard';
import './style.css';
import menuData from './menuData.json'; // JSON 데이터 임포트

export default function MenuCardList() {
  const menu1 = menuData[0];
  const menu2 = menuData[1];
  const menu3 = menuData[2];
  const menu4 = menuData[3];
  const menu5 = menuData[4];

  return (
    <div className="menu_card_list">
      <MenuCard
        pictureUrl={menu1.pictureUrl}
        menuName={menu1.menuName}
        state={menu1.state}
        bestComment={menu1.bestComment}
        likes={menu1.likes}
        dislikes={menu1.dislikes}
      />
      <MenuCard
        pictureUrl={menu2.pictureUrl}
        menuName={menu2.menuName}
        state={menu2.state}
        bestComment={menu2.bestComment}
        likes={menu2.likes}
        dislikes={menu2.dislikes}
      />
      <MenuCard
        pictureUrl={menu3.pictureUrl}
        menuName={menu3.menuName}
        state={menu3.state}
        bestComment={menu3.bestComment}
        likes={menu3.likes}
        dislikes={menu3.dislikes}
      />
      <MenuCard
        pictureUrl={menu4.pictureUrl}
        menuName={menu4.menuName}
        state={menu4.state}
        bestComment={menu4.bestComment}
        likes={menu4.likes}
        dislikes={menu4.dislikes}
      />
      <MenuCard
        pictureUrl={menu5.pictureUrl}
        menuName={menu5.menuName}
        state={menu5.state}
        bestComment={menu5.bestComment}
        likes={menu5.likes}
        dislikes={menu5.dislikes}
      />
    </div>
  );
}
